import styled from 'styled-components';

export const BodyHomeBody = styled.body`
    width:1280px;
    height:720px;
    margin: auto;
    background-color: #ffffff;
    z-index : 1;
`;
export const BodyDiv = styled.div`
    padding:20%;
`;
export const BodyP = styled.p`
    border: solid #5B6DCD 2px;
    padding: 5px;
    width: 100%;
    text-align:center;
    z-index : 1;
`;
